import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Datetoday from '../../Components/AllComponent/Datetoday.js'
import { ScrollView } from 'react-native';
import { useState } from 'react';
import Floorsection from './Roomcomponent/Floorsection';
import { Link } from 'react-router-dom';
import { Divider, Paper } from '@material-ui/core';
import { blue } from '@material-ui/core/colors';
import { useEffect } from 'react';
import axios from 'axios';
import { Button } from 'react-bootstrap';
const useStyles = makeStyles((theme) => ({
    frame: {
        width: '1163px',
        height: '105px',
    },

    scrollspace: {
        height: "730px",
        width: '1163px',
        margin: 'auto',
        paddingLeft: 110,
        transition: 'all 0.5s ease'

    },
    scrollspace36: {
        height: "730px",
        width: '1163px',
        margin: 'auto',
        paddingLeft: 36,
        transition: 'all 0.5s ease'

    },
    paper: {
        width: '1163px',
        height: '494px',
        boxShadow: "0px 0px 0px #E8E8E8",
        borderRadius: 5,
        border: "1px solid #AAAAAA",
    },
    fameinfo: {
        width: 670,
        height: 310,
        display: 'absolute',
        float: 'right',
        marginTop: '28px',
        marginRight: '127px'
    },
    famerow: {
        height: "59.86px",
        width: "100%",
        display: "flex",
        position: "relative"

    },
    grab: {
        height: "9.7px",
        width: "100%",
        backgroundColor: "white"
    },
    famerow2: {
        height: "31.55px",
        width: "100%",
        position: 'relative',
        display: "flex"

    },
    input_md: {
        height: "31.551px",
        width: "100%",
        fontSize: "16px",
        color: "#4A4A4A",
        border: "1px solid #D3D3D3",
        marginTop: 24,
        borderRadius: 4
    },
    input_sm: {
        width: "156.13px",
        height: "100%",
        fontSize: "16px",
        color: "#4A4A4A",
        border: "1px solid #D3D3D3",
        marginTop: 24,
        borderRadius: 4

    },
    input_full: {
        width: "100%",
        height: "31.5px",
        fontSize: "16px",
        color: "#4A4A4A",
        postion: "absolute",
        marginTop: 28.5,
        border: "1px solid #D3D3D3",
        marginTop: 24,
        borderRadius: 4
    },
    grab4: {
        width: "16.18px"
    },
    block_md: {
        width: "327.645px",
        height: "100%",
    },
    headname: {
        fontSize: "16px",
        color: "#4A4A4A",
        position: "absolute"
    },
    block_sm2: {
        width: "155.429px",
        height: "100%",

    }
}));

export default function Personalinfopage({ isOpened }) {
    const classes = useStyles()


    const [name, setName] = useState("")


    const [allData, setAllData] = useState([])

    useEffect(() => {
        axios('/user/user-room/1')
            .then(response => {
                console.log(response.data)
                setAllData(response.data);

            })
            .catch(error => {
                console.log('Error getting fake data: ' + error);
            })


    }, []);




    return (
        <ScrollView>
            <div className={isOpened ? classes.scrollspace36 : classes.scrollspace}>
                <div>

                    <div className={classes.frame}>
                        <Datetoday />
                    </div>
                    <Paper className={classes.paper}>
                        <div style={{ height: '111.6px', width: '100%' }}>

                        </div>
                        <Divider />
                        <div className={classes.fameinfo}>
                            <div className={classes.famerow}> {/*   First Name, Last Name */}
                                <div className={classes.block_md}>
                                    <div className={classes.headname}>
                                        First Name
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <div className={classes.input_md} contenteditable="true" value={allData.length > 0 ? allData[0].firstName : ""} >
                                        {allData.length > 0 ? allData[0].firstName : ""}
                                    </div>

                                </div>
                                <div className={classes.grab4} />
                                <div className={classes.block_md}>
                                    <div className={classes.headname}>
                                        Last Name
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <div className={classes.input_md} contenteditable="true">
                                        {allData.length > 0 ? allData[0].lastName : ""}

                                    </div>
                                </div>
                            </div>
                            <div className={classes.grab} />
                            <div className={classes.famerow}> {/*  Date of Birth, Gender, Identification Number / Passport Number */}

                                <div className={classes.block_sm2}>
                                    <div className={classes.headname}>
                                        Date of Birth
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <div className={classes.input_md} contenteditable="true">
                                        {allData.length > 0 ? allData[0].birthDate : ""}

                                    </div>
                                </div>
                                <div className={classes.grab4} />
                                <div className={classes.block_sm2}>
                                    <div className={classes.headname}>
                                        Gender
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <div className={classes.input_md} contenteditable="true">
                                        {allData.length > 0 ? allData[0].gender : ""}

                                    </div>
                                </div>
                                <div className={classes.grab4} />
                                <div className={classes.block_md}>
                                    <div className={classes.headname}>
                                        Identification Number / Passport Number
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <div className={classes.input_md} contenteditable="true" >
                                        {allData.length > 0 ? allData[0].gender : ""}

                                    </div>
                                </div>
                            </div>
                            <div className={classes.grab} />
                            <div className={classes.famerow} > {/*  Address */}
                                <div className={classes.headname}>
                                    Address
                                </div>
                                <div className={classes.input_full} contenteditable="true" >
                                    {allData.length > 0 ? allData[0].address : ""}

                                </div>
                            </div>
                            <div className={classes.grab} />

                            <div className={classes.famerow2} style={{ position: 'relative', marginTop: -26 }}> {/*   District, Sub-district, Province, Zip code */}
                                <div className={classes.input_sm} contenteditable="true" placeholder="District">
